import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';

const Profile = () => {
  const { id } = useParams();
  const history = useNavigate();
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [editMode, setEditMode] = useState(false);
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    profile_photo: '',
    bio: '',
    location: '',
    contact_info: ''
  });

  useEffect(() => {
    const fetchUserData = async () => {
      const token = localStorage.getItem('token');
      console.log('Token_profile:', token);  // Debug log
      if (!token) {
        setError('No token found');
        setLoading(false);
        return;
      }

      try {
        console.log('Fetching user data for ID:', id);  // Debug log

        const response = await fetch(`http://localhost:5000/api/users/${id}`, {
          headers: {
            'Authorization': `Bearer ${token}`,
            'Content-Type': 'application/json',
          },
        });

        console.log('Response status:', response.status);  // Debug log
        const data = await response.json();
        console.log('Response data:', data);  // Debug log

        if (response.ok) {
          setUser(data);
          setFormData({
            name: data.name,
            email: data.email,
            profile_photo: data.profile_photo,
            bio: data.bio,
            location: data.location,
            contact_info: data.contact_info
          });
        } else {
          setError(data.message || 'Error fetching user data');
        }
      } catch (err) {
        console.error('Fetch error:', err);  // Debug log
        setError('Failed to fetch user data');
      } finally {
        setLoading(false);
      }
    };

    fetchUserData();
  }, [id]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleUpdate = async () => {
    const token = localStorage.getItem('token');
    if (!token) {
      setError('No token found');
      return;
    }

    try {
      const response = await fetch(`http://localhost:5000/api/users/${id}`, {
        method: 'PUT',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData)
      });

      if (response.ok) {
        const data = await response.json();
        setUser(data);
        setEditMode(false);
      } else {
        const data = await response.json();
        setError(data.message || 'Error updating user data');
      }
    } catch (err) {
      console.error('Update error:', err);  // Debug log
      setError('Failed to update user data');
    }
  };

  const handleDelete = async () => {
    const token = localStorage.getItem('token');
    if (!token) {
      setError('No token found');
      return;
    }

    try {
      const response = await fetch(`http://localhost:5000/api/users/${id}`, {
        method: 'DELETE',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json',
        },
      });

      if (response.ok) {
        history.push('/');  // Redirect to another page after deletion
      } else {
        const data = await response.json();
        setError(data.message || 'Error deleting user');
      }
    } catch (err) {
      console.error('Delete error:', err);  // Debug log
      setError('Failed to delete user');
    }
  };

  if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;
  if (!user) return <div>No user data available</div>;

  return (
    <div>
      <h1>{editMode ? 'Edit Profile' : user.name}</h1>
      <p>Email: {editMode ? <input type="email" name="email" value={formData.email} onChange={handleInputChange} /> : user.email}</p>
      <p>Profile Photo: {editMode ? <input type="text" name="profile_photo" value={formData.profile_photo} onChange={handleInputChange} /> : user.profile_photo}</p>
      <p>Bio: {editMode ? <input type="text" name="bio" value={formData.bio} onChange={handleInputChange} /> : user.bio}</p>
      <p>Location: {editMode ? <input type="text" name="location" value={formData.location} onChange={handleInputChange} /> : user.location}</p>
      <p>Contact Info: {editMode ? <input type="text" name="contact_info" value={formData.contact_info} onChange={handleInputChange} /> : user.contact_info}</p>

      {editMode ? (
        <button onClick={handleUpdate}>Update</button>
      ) : (
        <button onClick={() => setEditMode(true)}>Edit</button>
      )}
      <button onClick={handleDelete}>Delete</button>
    </div>
  );
};

export default Profile;
